import './App.css';
import { decrementHandler, incrementHandler, resetHandler } from './redux/actions';


function App() {
  const dispatch = useDispatch()
  const handleIncrement=()=>{
    dispatch(incrementHandler())
  }
  const handleDecrement=()=>{
    dispatch(decrementHandler())
  }
  const handleReset=()=>{
    dispatch(resetHandler())
  }
  const l7esba = useSelector((state)=>state.l7esba)
  return (
    <div className="App">
    <button onClick={handleIncrement}>zid</button>
    <button onClick={handleDecrement}>na9s</button>
    <button >{l7esba}</button>
    <button onClick={handleReset}>safer</button>
    </div>
  );
}

export default App;
